from tkinter import *
import mainForm


def foc_in(root, event=None):
    root.config(cursor="hand2")


def foc_out(root, event=None):
    root.config(cursor="")


def goToGithub(event=None):
    import webbrowser
    webbrowser.open_new_tab('https://github.com/evanmana/')


def getBgIcon():
    icon = ""
    return icon


def aboutApp():
    root = Toplevel()
    windowWidth = 540
    windowHeight = 320
    screenWidth = root.winfo_screenwidth()
    screenHeight = root.winfo_screenheight()
    positionRight = int(screenWidth / 2 - windowWidth / 2)
    positionDown = int(screenHeight / 3 - windowHeight / 2)
    img = PhotoImage(data=mainForm.Cerberus.getAppIcon())
    root.wm_iconphoto(True, img)

    root.focus()
    root.geometry("{}x{}+{}+{}".format(windowWidth, windowHeight, positionRight, positionDown))
    root.title('Περί Cerberus')
    root.wm_attributes("-topmost", True)

    bgImage = PhotoImage(data=getBgIcon())
    background_label = Label(root, image=bgImage)
    background_label.place(x=0, y=0, relwidth=1, relheight=1)

    developedByLbl = Label(root, text='Powered by Evangelos Manavis ©', fg='white', bg='black', font=("Arial", 9))
    developedByLbl.pack(side='bottom')

    developedByLbl.bind("<Enter>", lambda x: foc_in(root))
    developedByLbl.bind("<Leave>", lambda x :foc_out(root))
    developedByLbl.bind("<Button-1>", goToGithub)
    root.bind("<FocusOut>", lambda x: root.destroy())
    root.bind('<Escape>', lambda x: root.destroy())
    root.resizable(0, 0)
    root.mainloop()